import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import LogoutButton from './LogoutButton';

const EmployeeNavbar = () => {
  const { user } = useAuth();
  const location = useLocation();

  const isActive = (path) => {
    return location.pathname === path;
  };

  return (
    <nav className="employee-navbar">
      <div className="navbar-container">
        <div className="navbar-brand">
          <Link to="/employee/orders" className="brand-link">
            <h2>Glowiva</h2>
            <span className="employee-badge">Employee Portal</span>
          </Link>
        </div>

        <div className="navbar-menu">
          <Link 
            to="/employee/orders" 
            className={`nav-link ${isActive('/employee/orders') ? 'active' : ''}`}
          >
            My Orders
          </Link>
          <Link 
            to="/employee/products" 
            className={`nav-link ${isActive('/employee/products') ? 'active' : ''}`}
          >
            Products
          </Link>
          <Link 
            to="/employee/profile" 
            className={`nav-link ${isActive('/employee/profile') ? 'active' : ''}`}
          >
            Profile
          </Link>
        </div>

        <div className="navbar-user">
          <div className="user-info">
            <span className="user-name">
              {user?.firstName} {user?.lastName}
            </span>
            <span className="user-role">Employee</span>
          </div>
          <LogoutButton 
            className="logout-button"
            style={{
              background: 'rgba(255, 255, 255, 0.2)',
              color: 'white',
              border: '1px solid rgba(255, 255, 255, 0.3)',
              padding: '8px 16px',
              borderRadius: '8px',
              fontWeight: '500',
              cursor: 'pointer',
              transition: 'all 0.2s ease',
              display: 'flex',
              alignItems: 'center',
              gap: '6px'
            }}
          />
        </div>
      </div>

      <style jsx>{`
        .employee-navbar {
          background: rgba(255, 255, 255, 0.95);
          backdropFilter: blur(20px);
          color: #333;
          padding: 0 20px;
          boxShadow: 0 8px 32px rgba(0, 0, 0, 0.1);
          position: fixed;
          top: 0;
          left: 0;
          right: 0;
          zIndex: 1000;
          border: 1px solid rgba(255, 255, 255, 0.2);
          borderTop: none;
        }

        .navbar-container {
          display: flex;
          align-items: center;
          justify-content: space-between;
          max-width: 1400px;
          margin: 0 auto;
          height: 80px;
        }

        .navbar-brand {
          display: flex;
          align-items: center;
        }

        .brand-link {
          text-decoration: none;
          color: #667eea;
          display: flex;
          align-items: center;
          gap: 12px;
        }

        .brand-link h2 {
          margin: 0;
          font-size: 24px;
          font-weight: 700;
          background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
          -webkit-background-clip: text;
          -webkit-text-fill-color: transparent;
          background-clip: text;
        }

        .employee-badge {
          background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
          color: white;
          padding: 6px 12px;
          border-radius: 20px;
          font-size: 11px;
          font-weight: 600;
          text-transform: uppercase;
          letter-spacing: 0.5px;
        }

        .navbar-menu {
          display: flex;
          gap: 30px;
          align-items: center;
        }

        .nav-link {
          color: #64748b;
          text-decoration: none;
          font-weight: 500;
          padding: 12px 20px;
          border-radius: 12px;
          transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
          position: relative;
          overflow: hidden;
        }

        .nav-link:hover {
          background: rgba(102, 126, 234, 0.1);
          color: #667eea;
          transform: translateY(-1px);
        }

        .nav-link.active {
          background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
          color: white;
          transform: translateY(-2px);
          box-shadow: 0 8px 25px rgba(102, 126, 234, 0.4);
        }

        .navbar-user {
          display: flex;
          align-items: center;
          gap: 20px;
        }

        .user-info {
          display: flex;
          flex-direction: column;
          align-items: flex-end;
        }

        .user-name {
          font-weight: 600;
          font-size: 14px;
        }

        .user-role {
          font-size: 12px;
          opacity: 0.8;
        }



        @media (max-width: 768px) {
          .navbar-container {
            padding: 0 15px;
            height: 60px;
          }

          .brand-link h2 {
            font-size: 20px;
          }

          .employee-badge {
            display: none;
          }

          .navbar-menu {
            gap: 15px;
          }

          .nav-link {
            padding: 6px 12px;
            font-size: 14px;
          }

          .user-info {
            display: none;
          }

          .logout-button {
            padding: 6px 12px;
            font-size: 14px;
          }
        }

        @media (max-width: 480px) {
          .navbar-menu {
            gap: 10px;
          }

          .nav-link {
            padding: 4px 8px;
            font-size: 12px;
          }
        }
      `}</style>
    </nav>
  );
};

export default EmployeeNavbar;
